const request = require('supertest');
const index = require('../server')
const mongoose = require("mongoose");
const dotenv = require("dotenv");
const { expect, assert } = require('chai');

dotenv.config();

const app = index.app;

describe('POST /register', () => {
    it('attempts to create an existing user', (done) => {
      request(app)
        .post('/register')
        .send({
          username: 'test12@gmail.com',
          password: '1234',
        })
        .expect(200)
        done();
    });
});

describe('POST /login', () => {
    it('attempts to login an existing user', (done) => {
      request(app)
        .post('/login')
        .send({
          username: 'test12@gmail.com',
          password: '1234',
        })
        .expect(200)
        done();
    });
});

describe('POST /api/cars/addcar', () => {
  it('attempts to add a car', (done) => {
    request(app)
      .post('/api/cars/addcar')
      .send({
        name: "Range Rover",
        image: "data:image/jpeg;base64,",
        capacity: 5,
        fuelType: "Petrol",
        rentPerHour: 2000,
      })
      .expect(200)
      done();
  });
});

describe('POST /api/cars/addcar', () => {
  it('attempts to add a car with negative rent', (done) => {
    request(app)
      .post('/api/cars/addcar')
      .send({
        name: "Range Rover",
        image: "data:image/jpeg;base64,",
        capacity: 5,
        fuelType: "Petrol",
        rentPerHour: -2000,
      })
      .expect(400)
      .end((err, res) =>{
        if(err) return done(err);
        assert.equal(res.body.message, 'RentPerHour must be a positive number!' );
        done()
      })
  });
});

describe('POST /api/cars/addcar', () => {
  it('attempts to add a car with negative capacity', (done) => {
    request(app)
      .post('/api/cars/addcar')
      .send({
        name: "Range Rover",
        image: "data:image/jpeg;base64,",
        capacity: -5,
        fuelType: "Petrol",
        rentPerHour: 2000,
      })
      .expect(400)
      .end((err, res) =>{
        if(err) return done(err);
        assert.equal(res.body.message, 'Capacity must be a positive number!' );
        done()
      })
  });
});